      <label>
        Name:
        <input type="text" value={name} placeholder='Enter Name' onChange={handleNameChange} />
      </label>
      <label>
        Email:
        <input type="email" value={email} placeholder='Enter Email' onChange={handleEmailChange} />
      </label>
      <label>
